// src/components/CategoryCard.js
import React from "react";
import { Card, CardActionArea, CardMedia, CardContent, Typography } from "@mui/material";
import getCategoryImage from "../utils/categoryImageMap";

export default function CategoryCard({ category, onClick }) {
  const img = getCategoryImage(category);
  const title = category.name || category.title || category.slug;
  return (
    <Card>
      <CardActionArea onClick={onClick}>
        <CardMedia component="img" height="140" image={img} alt={title} />
        <CardContent>
          <Typography variant="subtitle1" align="center">{title}</Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
